import React, { useState } from 'react';

function VehicleForm() {
    const [formData, setFormData] = useState({
        brand: '',
        model: '',
        year: '',
        color: '',
        plate: ''
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Aquí puedes hacer lo que quieras con los datos del formulario
        console.log('Datos del formulario:', formData);
        // Por ejemplo, puedes enviarlos a un servidor o almacenarlos localmente
    };

    return (
        <div>
            <h2>Formulario de Vehículo</h2>
            <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column' }}>
                <label htmlFor="brand">Marca:</label>
                <input type="text" id="brand" name="brand" value={formData.brand} onChange={handleChange} required /><br /><br />

                <label htmlFor="model">Modelo:</label>
                <input type="text" id="model" name="model" value={formData.model} onChange={handleChange} required /><br /><br />

                <label htmlFor="year">Año:</label>
                <input type="number" id="year" name="year" value={formData.year} onChange={handleChange} min="1900" max="2099" required /><br /><br />

                <label htmlFor="color">Color:</label>
                <input type="text" id="color" name="color" value={formData.color} onChange={handleChange} required /><br /><br />

                <label htmlFor="plate">Matrícula:</label>
                <input type="text" id="plate" name="plate" value={formData.plate} onChange={handleChange} required /><br /><br />

                <button type="submit">Enviar</button>
            </form>

        </div>
    );
}

export default VehicleForm;
